import React from "react";

export interface IconProps {
	className?: string;
	width?: number;
	height?: number;
}


// UTILITY FUNCTIONS
export const getButtonRadiusIcon = (radius: ButtonRadiusIconName) => {
	return buttonRadiusIconMap[radius];
};

export const getRealestateIcon = (icon: RealestateIconName) => {
	return realestateIconMap[icon];
};



